import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';
import Box from '@material-ui/core/Box';
import ImageCarousel from 'components/Item/ItemInfo/ImageCarousel';
import ItemDescription from 'components/Item/ItemInfo/ItemDescription';

const useStyles = makeStyles(theme => ({
  img: {
    width: '100%',
    height: '100%'
  }
}));

const ItemsPage = () => {
  const classes = useStyles();
  return (
    <React.Fragment>
      <Grid container spacing={0} justify="center">
        <Grid item md={1}></Grid>
        <Grid item md={4}>
          <ImageCarousel />
        </Grid>
        <Grid item md={6}>
          <ItemDescription />
        </Grid>
        <Grid item md={1}></Grid>
      </Grid>
      <Box>
        <img className={classes.img} src={require(`assets/temp/google-maps-placeholder.png`)} />
      </Box>
    </React.Fragment>
  );
};

export default ItemsPage;
